import './App.css';
import { BrowserRouter as Router , Routes, Route, Link } from 'react-router-dom';
import React, { Component } from 'react'
import Nav from './components/Nav';
import News from './components/News';

export default class App extends Component {
  render() {
    return (
      <Router>
      <div>
        <Nav />
        <Routes>
          <Route exact path='/'element={<News key='general' pageSize ={9} country='in' category='general'/>}/>
          <Route exact path='/business' element={<News key='general' pageSize ={9} country='in' category='business'/>}/>
          <Route exact path='/entertainment' element={<News key='general' pageSize ={9} country='in' category='entertainment'/>}/>
          <Route exact path='/general' element={<News pageSize ={9} country='in' category='general'/>}/>
          <Route exact path='/health' element={<News pageSize ={9} country='in' category='health'/>}/>
          <Route exact path='/science' element={<News pageSize ={9} country='in' category='science'/>}/>
          <Route exact path='/sports' element={<News pageSize ={9} country='in' category='sports'/>}/>
          <Route exact path='/technology' element={<News pageSize ={9} country='in' category='technology'/>}/>
        </Routes>

      </div>
      </Router>
    )
  }
}
